{'managerName': 'R. Eric  Chadwick', 'managerBio': "Mr. Chadwick has managed preferred securities at Flaherty & Crumrine since 1999 and is a member of the firmâ\x80\x99s portfolio management team. As one of the firm's traders, he shares responsibility for implementing investment strategies. Mr. Chadwick is also involved in the development of tools for managing the portfolios and developing firm-wide systems. Together with Mr. Conwell and Mr. Stone, he serves on the firm's board of directors and is a member of the executive management committee. He also serves as President of the U.S. Flaherty & Crumrine closed-end funds.

Prior to joining Flaherty & Crumrine in 1999, he worked at Koch Industries Inc. where he was responsible for managing sizable portfolios of both preferred securities and corporate bonds. He was also responsible for developing analytical tools used in the management of the portfolios, and providing fundamental research on a broad range of credits.

Mr. Chadwick earned his M.B.A. from the UCLA Anderson School of Management and his B.S. in Economics from the University of Kansas.", 'startdate': 1302566400}

{'managerName': 'Di V. Kumble', 'managerBio': 'Managing Director, Senior Portfolio Manager, Head of Tax Managed Equities: New York

