{'managerName': 'William O. Bell', 'managerBio': "William O. Bell, IV, CFA is a Vice President and Principal of the firm. He serves as a portfolio manager for Atlanta Capital's Small Cap, SMID Cap and Select Equity portfolios. He is also a member of the Management Committee. 

Prior to joining the firm in 1999, Mr. Bell was a portfolio manager with the Florida State Board of Administration where he was responsible for managing their internal special situation equity fund.

Mr. Bell holds the Chartered Financial Analyst designation and is a graduate of Florida State University where he earned a Bachelor of Science degree in Business.", 'startdate': 1099180800}
